script: |
  super -f text -I q11321.spq | sort > q11321.out

inputs:
  - name: q11321.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT - col0 * + col1 * - col2 * - + col1 + + col1 >= - - col1 * col2 + 90 + - col0 / col0 * - col1;
  - name: tab0

outputs:
  - name: q11321.out
    data: |
      15	81	47
      87	21	10
      97	1	99
